import React, { Component } from 'react'

export class Good extends Component {
  render() {
    return (
      <div className='good'>
        {this.props.Good.title}
        {this.props.Good.desc}
        {this.props.Good.title}
        {this.props.Good.title}
        </div>
    )
  }
}

export default Good
